import React from "react";

const Login = () => {
	return (
		<div className=" flex-col justify-center items-center h-screen">
			<div>
				<p>Sign In Your Account</p>
			</div>
			<form>
				<p>Email</p>
				<input />
				<p>Password</p>
				<input />
			</form>
		</div>
	);
};

export default Login;
